<script setup>
import { gsap } from "gsap";

let canvas;
let image;
let ctx;
let effect;
let reqAnimation;

const params = ref({
    size: 3,
    ease: 0.2,
    vx: 0,
    vy: 0,
    radius: 3000,
    friction: 0.9,
});
const controlClose = ref(true);

class Particle {
    constructor(effect, x, y, color) {
        this.effect = effect;
        this.x = Math.random() * this.effect.width;
        this.y = Math.random() * this.effect.height;
        this.originX = Math.floor(x);
        this.originY = Math.floor(y);
        this.color = color;
        this.size = this.effect.gap;
        // this.vx = Math.random() * 2 - 1;
        // this.vy = Math.random() * 2 - 1;
        this.vx = parseFloat(params.value.vx);
        this.vy = parseFloat(params.value.vy);
        this.ease = parseFloat(params.value.ease);
        this.friction = parseFloat(params.value.friction);
        this.dx = 0;
        this.dy = 0;
        this.distance = 0;
        this.force = 0;
        this.angle = 0;
    }
    draw(context) {
        context.fillStyle = this.color;
        context.fillRect(this.x, this.y, this.size, this.size);
    }
    update() {
        this.dx = this.effect.mouse.x - this.x;
        this.dy = this.effect.mouse.y - this.y;
        this.distance = this.dx * this.dx + this.dy * this.dy;
        this.force = -this.effect.mouse.radius / this.distance;

        if (this.distance < this.effect.mouse.radius) {
            this.angle = Math.atan2(this.dy, this.dx);
            this.vx += this.force * Math.cos(this.angle);
            this.vy += this.force * Math.sin(this.angle);
        }

        this.x +=
            (this.vx *= this.friction) + (this.originX - this.x) * this.ease;
        this.y +=
            (this.vy *= this.friction) + (this.originY - this.y) * this.ease;
    }
    warp() {
        this.x = Math.random() * this.effect.width;
        this.y = Math.random() * this.effect.height;
    }
}
class Effect {
    constructor(width, height) {
        this.width = width;
        this.height = height;
        this.particlesArray = [];
        this.image = image;
        this.x = (this.width - this.height / 2) / 2;
        this.y = this.height / 4;
        this.gap = parseFloat(params.value.size);
        this.mouse = {
            radius: parseFloat(params.value.radius),
            x: undefined,
            y: undefined,
        };
        window.addEventListener("mousemove", (e) => {
            this.mouse.x = e.x;
            this.mouse.y = e.y;
        });
        window.addEventListener("touchmove", (e) => {
            this.mouse.x = e.targetTouches[0].clientX;
            this.mouse.y = e.targetTouches[0].clientY;
        });
        window.addEventListener("touchend", (e) => {
            this.mouse.x = undefined;
            this.mouse.y = undefined;
        });
    }
    init(context) {
        context.drawImage(
            this.image,
            this.x,
            this.y,
            this.height / 2,
            this.height / 2
        );
        const pixels = context.getImageData(0, 0, this.width, this.height).data;
        for (let y = 0; y < this.height; y += this.gap) {
            for (let x = 0; x < this.width; x += this.gap) {
                const index = (y * this.width + x) * 4;
                const red = pixels[index];
                const green = pixels[index + 1];
                const blue = pixels[index + 2];
                const alpha = pixels[index + 3];
                const color = `rgb(${red},${green},${blue})`;
                if (alpha > 0) {
                    this.particlesArray.push(new Particle(this, x, y, color));
                }
            }
        }
    }
    draw(context) {
        this.particlesArray.forEach((particle) => particle.draw(context));
    }
    update() {
        this.particlesArray.forEach((particle) => particle.update());
    }
    warp() {
        this.particlesArray.forEach((particle) => particle.warp());
    }
}

const animation = () => {
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    effect.draw(ctx);
    effect.update();
    reqAnimation = requestAnimationFrame(animation);
};

const controlTransition = () => {
    console.log("ok");
    if (controlClose.value) {
        gsap.to(".mainControls", {
            yPercent: 100,
            duration: 0.3,
            ease: "circle.out",
            onComplete: () => (controlClose.value = false),
        });
    } else {
        gsap.to(".mainControls", {
            yPercent: 0,
            duration: 0.3,
            ease: "circle.out",
            onComplete: () => (controlClose.value = true),
        });
    }
};

onMounted(() => {
    setTimeout(() => {
        canvas = document.getElementById("canvas-particles");
        image = document.getElementById("canvas-image-particles");
        ctx = canvas.getContext("2d", { willReadFrequently: true });
        canvas.width = window.innerWidth;
        canvas.height = window.innerHeight;

        effect = new Effect(canvas.width, canvas.height);
        effect.init(ctx);

        animation();
    }, 1000);
});
onBeforeUnmount(() => {
    window.cancelAnimationFrame(reqAnimation);
    ctx.clearRect(0, 0, canvas.width, canvas.height);
});
watch(params.value, (value) => {
    window.cancelAnimationFrame(reqAnimation);
    ctx.clearRect(0, 0, canvas.width, canvas.height);

    effect = new Effect(canvas.width, canvas.height);
    effect.init(ctx);

    animation();
});
</script>

<template>
    <div class="main">
        <canvas id="canvas-particles"></canvas>
        <img
            id="canvas-image-particles"
            src="data:image/png;base64,"
        />
        <div class="mainControls">
            <label for="size"
                >PixelSize : <span>{{ params.size }}</span></label
            >
            <input
                id="size"
                class="mainInput"
                type="range"
                v-model="params.size"
                min="3"
                max="15"
            />

            <label for="ease"
                >Ease : <span>{{ params.ease }}</span></label
            >
            <input
                id="ease"
                class="mainInput"
                type="range"
                v-model="params.ease"
                min="0.1"
                max="1.5"
                step="0.1"
            />

            <label for="vx"
                >VectorX : <span>{{ params.vx }}</span></label
            >
            <input
                id="vx"
                class="mainInput"
                type="range"
                v-model="params.vx"
                min="0.1"
                max="1.5"
                step="0.1"
            />

            <label for="vy"
                >VectorY : <span>{{ params.vy }}</span></label
            >
            <input
                id="vy"
                class="mainInput"
                type="range"
                v-model="params.vy"
                min="0.1"
                max="1.5"
                step="0.1"
            />

            <label for="radius"
                >Radius : <span>{{ params.radius }}</span></label
            >
            <input
                id="radius"
                class="mainInput"
                type="range"
                v-model="params.radius"
                min="1000"
                max="10000"
                step="500"
            />

            <label for="friction"
                >Friction : <span>{{ params.friction }}</span></label
            >
            <input
                id="friction"
                class="mainInput"
                type="range"
                v-model="params.friction"
                min="0.1"
                max="0.95"
                step="0.05"
            />
            <div class="mainControlsState" @click="controlTransition">
                <span v-if="controlClose">Open</span>
                <span v-else>Close</span>
            </div>
        </div>
    </div>
</template>

